import React, { useEffect } from 'react';

import { useParams } from 'react-router-dom';

import classes from './orderView.module.css';

function OrderView(props){
    const {oid} = useParams();

    useEffect(() => {
        document.title = 'Order Details';
    });

    return(
        <div className={classes.layout}>
            <div>
                <p><span className={classes.head}>Placed On:</span> 12 May 2018</p>
                <p><span className={classes.head}>Order No:</span> {oid}</p>
                <p><span className={classes.head}>Total Amount:</span> &#8377;&nbsp;200</p>
            </div>
            <hr></hr>
            <div>
                <p>Contact Details</p>
            </div>
        </div>
    );
}

export default OrderView;
